Anastacia: Live at Last 	

Anastacia: Live at Last is a DVD collection from pop/rock music singer Anastacia, released on March 27, 2006. It&amp;#039;s her first full live concert DVD. It includes footage from concerts in Berlin [Velodome ? October 24, 2004] and Munich [Olympiahall ? October 26, 2004]. It also features her four last single music videos and some alternate videos to songs.

